import React from 'react'

const CollectionOverview = () => {
    return (
        <div>
            {collections.map(({ id, ...otherCollectionProps }) => (
                <CollectionOverview key={id} {...otherCollectionProps} />
        ))}
        </div>
    )
}

export default CollectionOverview
